    const [loading, setLoading] = useState(false);
    const [goods, setGoods] = useState([]);

    useEffect(() => {
        setLoading(true)
        fetch(API_URL, {
            headers: {
                Authorization: API_KEY
            }
        })
            .then(res => res.json())
            .then(data => setGoods(data.featured))

        setLoading(false)
    }, []);
    console.log(goods)
